import { useStore } from "../store";
import { observer } from "mobx-react-lite";

export default observer(function AF_Inputs({ manyAlgos, manyFunctions }) {

    const { appStore } = useStore();

    if (manyAlgos) {
        return (
    
            <table className="bp4-html-table .modifier">
                <thead>
                    <tr>
                        <th>l.p.</th>
                        <th>nazwa</th>
                    </tr>
                </thead>
                <tbody>
                    {appStore.algorithms.map(algo => (
                        <tr key={algo.id}>
                            <td>{algo.id}</td>
                            <td>{algo.name}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        )
    }

    


})
